s($,"aJQ","atg",()=>A.a([A.wM("Professional home recording studio project (2021 - present)","In this ongoing project, I have designed and built a professional home recording studio. The studio is equipped with state-of-the-art audio equipment and acoustic treatments to ensure optimal sound quality. The project involved careful planning, selection of appropriate equipment, and meticulous installation to create a conducive environment for audio production.\n\nAs part of the project, I have gained extensive experience in mixing and mastering using analog studio equipment. This includes working with high-quality audio processors, equalizers, compressors, and other analog gear to achieve professional-grade sound. The hands-on experience with analog equipment has allowed me to develop a keen ear for audio processing and an understanding of how to enhance recordings to their fullest potential.\n\nThroughout the project, I have had the opportunity to collaborate with clients from a record label. This experience has provided valuable insights into the music industry and allowed me to apply my technical expertise to meet the specific needs and artistic vision of the artists. Working closely with clients has strengthened my communication and collaboration skills, ensuring a smooth workflow and successful project outcomes.\n\nThe professional home recording studio project has been a rewarding and ongoing endeavor. It has allowed me to combine my passion for music with my technical skills, creating a space where artists can bring their creative visions to life. Through this project, I have expanded my knowledge of audio production, honed my skills in mixing and mastering, and gained valuable experience working with clients in the music industry.\n"),A.wM("Band (2019 - Present)","Since 2019, I have been involved in a thrilling journey of forming and being a part of an indie band with my high school friends. Together, we have embarked on a creative endeavor that has allowed us to showcase our musical talents and pursue our passion for music.\n\nOne of the key accomplishments of our band has been the production of captivating songs. We have poured our hearts and souls into the songwriting process, crafting melodies, lyrics, and arrangements that resonate with our audience. Through experimentation and collaboration, we have developed a unique sound that reflects our artistic vision and showcases our musical abilities.\n\nAlongside creating music, we have also taken the stage to perform live gigs. These performances have provided us with valuable experiences, allowing us to connect with our fans and share our music in a dynamic and energetic environment. Performing live has honed our stage presence, improved our musical skills, and strengthened the bond between band members.\n\nRecognizing the importance of online presence, we have actively marketed the band through various digital platforms. We have utilized social media, music streaming platforms, and our own website to promote our music, engage with fans, and expand our reach. These online efforts have enabled us to connect with a wider audience and build a dedicated fan base.\n\nAn exciting milestone for our band has been signing with a record label. This partnership has opened doors to new opportunities, providing us with professional guidance, resources, and a platform to reach a larger audience. Being signed to a record label has validated our hard work and dedication, and it has allowed us to take our musical journey to new heights.\n\nBeing a part of this band has been an incredibly fulfilling experience. It has allowed us to express ourselves creatively, collaborate with talented musicians, and connect with music lovers worldwide. Through our passion and commitment, we continue to evolve as a band, pushing boundaries, and striving to make a lasting impact in the music industry.\n"),A.wM("Reverb Music Productions Talent member (instrumentalist) (2019 - 2023) - University Org","As a member, I have had the opportunity to hone my multi-instrumental skills. The organization has provided a platform for me to explore and master various musical instruments, expanding my repertoire and versatility. Through workshops, rehearsals, and collaborative performances, I have gained proficiency in playing different instruments, allowing me to contribute to diverse musical productions.\n\nIn addition to musical development, my involvement in Reverb Music Productions has enhanced my communication skills. Collaborating with fellow musicians, directors, and producers has taught me the importance of effective communication in a creative environment. Whether it's conveying musical ideas, discussing performance logistics, or providing feedback, I have learned to articulate my thoughts clearly and work harmoniously with team members.\n\nBeing part of this music organization has not only allowed me to grow as an instrumentalist but also provided a sense of community and camaraderie. Through shared rehearsals, performances, and musical projects, I have built lasting relationships with fellow musicians who share a passion for music. The support and encouragement from the organization's members have created an inspiring environment that fuels my musical aspirations.\n\nReverb Music Productions has offered numerous performance opportunities, including concerts, and collaborations with other arts organizations. These experiences have pushed me out of my comfort zone, enabling me to showcase my musical abilities in front of audiences. Performing in various venues has further refined my stage presence and enriched my understanding of live music production.\n\nOverall, my involvement as a talent member in Reverb Music Productions has been a transformative journey. It has allowed me to develop my multi-instrumental skills, improve my communication abilities, and connect with a community of passionate musicians. Through this organization, I have discovered new musical horizons, nurtured my talent, and experienced the joy of creating and performing music alongside dedicated artists.\n"),A.wM("Reverb Music Productions Talent Development Head for Instrumentalists (2021 - 2022) - University Org","In my role as the Talent Development Head for Instrumentalists at Reverb Music Productions, a university music organization, I had the privilege of mentoring fellow instrumentalists and guiding their growth in performance skills.\n\nAs a mentor, my primary responsibility was to provide support, guidance, and constructive feedback to instrumentalists within the organization. I worked closely with individual musicians, helping them refine their techniques, musical interpretations, and overall performance abilities. Through personalized coaching sessions and rehearsals, I aimed to cultivate their musical talents and enhance their stage presence.\n\nBeing part of a music organization allowed me to leverage my own expertise and experiences as a musician. I shared my knowledge of instrumental techniques, musical theory, and interpretation, empowering mentees to explore new horizons and develop their own unique musical identities. I encouraged them to push their boundaries and embrace creative experimentation, fostering a spirit of artistic growth and exploration.\n\nLeadership skills were instrumental in my role as the Talent Development Head. I effectively coordinated rehearsals, provided clear instructions, and facilitated a collaborative and supportive environment for all instrumentalists. I guided the organization's vision for talent development, ensuring that each member had the opportunity to thrive and reach their full potential. By leading by example and nurturing a culture of teamwork and mutual respect, I fostered an inclusive and inspiring atmosphere for everyone involved.\n\nThrough this position, I not only enhanced my leadership skills but also gained a deeper appreciation for the transformative power of mentorship. Witnessing the growth and progress of the instrumentalists under my guidance was immensely rewarding. It reinforced my passion for music and fueled my commitment to helping others unlock their full potential as musicians.\n\nOverall, my role as the Talent Development Head for Instrumentalists at Reverb Music Productions allowed me to make a meaningful impact on the musical journeys of fellow musicians. It provided me with valuable leadership experience and allowed me to contribute to the vibrant musical community within the organization. I am grateful for the opportunity to have mentored and inspired instrumentalists, fostering their growth and fostering a shared passion for music.\n"),A.wM("Reverb Music Productions Head of Producers (2023) - University Org","As the Head of Producers at Reverb Music Productions, I have the privilege of mentoring and guiding music producers in honing their production skills and leading the organization's members in various projects and concerts.\n\nOne of my key responsibilities is to provide mentorship and support to music producers within the organization. I work closely with them, offering guidance on music production techniques, sound design, arrangement, and mixing/mastering processes. Through personalized coaching sessions and collaborative feedback, I help producers refine their skills, explore their creativity, and develop their own unique production styles. My aim is to foster an environment that nurtures growth and empowers producers to realize their artistic visions.\n\nIn addition to mentorship, I take the lead in organizing and overseeing projects and concerts. This involves coordinating with members, ensuring smooth communication and collaboration among producers, musicians, and other stakeholders. I guide the team in project planning, setting timelines, and managing resources effectively. By providing clear direction and facilitating a collaborative environment, I encourage creativity, teamwork, and the successful execution of projects and concerts.\n\nAs the Head of Producers, I strive to foster an inclusive and supportive culture within the organization. I encourage producers to share their ideas, collaborate with other musicians, and explore innovative approaches to music production. I promote a learning environment where producers can experiment, make mistakes, and grow from their experiences. By nurturing a sense of camaraderie and mutual respect, I aim to create a vibrant community of producers who inspire and uplift one another.\n\nBeing in this leadership position has allowed me to develop my own leadership skills, communication abilities, and project management expertise. I have gained valuable experience in guiding a team, delegating responsibilities, and overseeing the creative process from inception to completion. It has been immensely fulfilling to witness the growth and achievements of the producers and the organization as a whole.\n\nAs the Head of Producers at Reverb Music Productions, I am committed to providing mentorship, leadership, and guidance to music producers. I am dedicated to fostering their growth, facilitating collaborative projects, and creating memorable concerts that showcase the talent and creativity of our organization's members. It is a role that I am passionate about, and I am grateful for the opportunity to make a positive impact on the music production community within Reverb Music Productions.\n"),A.wM("Media Management Committee Junior Videographer (2023)  University Org","As a Junior Videographer for the Media Management Committee, I had the exciting opportunity to film various university events and contribute to the production of video projects.\n\nMy primary responsibility was to capture high-quality footage of university events, such as conferences, seminars, performances, and other special occasions. Armed with a camera and an eye for detail, I documented these events, ensuring that important moments and key highlights were recorded. I utilized my creative instincts to frame shots, experiment with different angles, and capture the essence of each event through visuals.\n\nIn addition to filming, I also played a role in the editing process of video projects. Using video editing software, I carefully selected and arranged the footage, incorporating transitions, effects, and audio elements to enhance the overall storytelling. I aimed to create engaging and visually appealing videos that effectively conveyed the messages and themes of the events.\n\nThroughout my time as a Junior Videographer, I honed my creative filming skills. By actively experimenting with composition, lighting, and camera movements, I developed a keen eye for capturing captivating visuals. I constantly sought ways to improve and push the boundaries of my craft, exploring new techniques and staying updated with the latest trends in videography.\n\nWorking as part of the Media Management Committee provided me with valuable hands-on experience in media production within a university setting. Collaborating with other committee members, including photographers, graphic designers, and social media managers, allowed me to gain insights into the larger picture of media management. It taught me the importance of effective teamwork, communication, and coordination to deliver cohesive and impactful visual content.\n\nBeing a Junior Videographer in the Media Management Committee was a fulfilling role that allowed me to contribute to the university's media presence and capture memorable moments. It not only allowed me to showcase my creative filming skills but also provided me with a deeper understanding of the power of visual storytelling. The experience helped me grow both professionally and personally, and I am grateful for the opportunity to have been part of the committee's important work in documenting and promoting university events.\n")],A.R("p<HE>")))
r($,"aJP","ak7",()=>A.a([A.amD("The Modular Synthesizer Project, undertaken from 2020 to 2021, was a passion project that allowed me to delve into the fascinating world of electronic music and synthesizers.\n\nOne of the primary objectives of the project was to prototype and construct various synthesizer modules. To accomplish this, I utilized KiCad, a powerful PCB design tool, to design and create the circuit boards for the modules. KiCad enabled me to create custom designs, define component placements, and ensure proper connectivity. Through this process, I developed a deep understanding of PCB design principles and techniques.\n\nIn addition to the analog modules, I also ventured into building a digital module using Arduino. Arduino, an open-source microcontroller platform, provided a flexible and accessible framework for programming and prototyping the digital aspects of the synthesizer. By leveraging Arduino's capabilities, I was able to develop a digital module that could generate and manipulate sound waves, offering a unique and customizable element to the modular synthesizer setup.\n\nThroughout the project, I dedicated significant time and effort to research and experimentation. I explored various circuit designs, studied the fundamentals of audio synthesis, and fine-tuned the modules to achieve the desired sonic characteristics. This iterative process allowed me to refine the modules' functionality and optimize their performance.\n\nThe Modular Synthesizer Project was not only a technical endeavor but also a personal journey driven by passion. It offered me an opportunity to explore my creativity and express my musical ideas through the design and construction of the synthesizer modules. The project fostered a deeper understanding of electronic music and the intricate mechanisms behind synthesizers.\n\nBy actively engaging in this passion project, I honed my skills in PCB design with KiCad and gained hands-on experience in working with Arduino for digital module development. The Modular Synthesizer Project provided a platform for self-expression, technical growth, and a deeper appreciation for the art of sound synthesis.\n","Modular Synthesizer Project (2020-2021) - Passion project"),A.amD("The Z80 8-Bit Computer Project, undertaken in 2020, was a passion project that allowed me to immerse myself in the world of retro computing and electronics.\n\nThe primary objective of the project was to construct an 8-bit computer using a Z80 processor and various peripheral components. The Z80, a popular microprocessor of the time, formed the heart of the computer and provided the computational power needed for the system. Through meticulous wiring and soldering, I assembled the computer, ensuring the proper connection of components such as memory, input/output devices, and control logic.\n\nTo enhance the functionality of the computer, I integrated NASCOM BASIC, a programming language and interpreter, which allowed users to write and execute programs. This addition made the computer versatile and capable of performing a wide range of tasks.\n\nDuring the project, I utilized Arduino and Python as an EPROM (Erasable Programmable Read-Only Memory) programmer. This involved writing custom programs in Python and using an Arduino board to interface with the EPROM chips, enabling the burning of program code onto the memory chips. This process allowed me to experiment with different software configurations, further expanding the capabilities of the computer.\n\nThe Z80 8-Bit Computer Project served as an avenue for honing problem-solving skills and fundamental computing knowledge. It required a deep understanding of digital electronics, computer architecture, and low-level programming concepts. Through hands-on experience and research, I gained insights into the inner workings of a computer system and learned how to troubleshoot and debug issues that arose during the construction and programming phases.\n\nThis passion project provided an opportunity to immerse myself in the world of vintage computing, exploring the roots of modern technology and gaining a deep appreciation for the evolution of computing systems. It not only allowed me to construct a functional 8-bit computer but also fostered a sense of accomplishment and satisfaction in bringing a retro computing project to life.\n\nIn summary, the Z80 8-Bit Computer Project was a passion-driven endeavor that involved building an 8-bit computer using a Z80 processor. The integration of NASCOM BASIC, the utilization of Arduino and Python as an EPROM programmer, and the development of problem-solving skills and fundamental computing knowledge were all integral parts of this project. Ultimately, the project provided a valuable experience in retro computing and an understanding of the foundations of modern computer technology.\n","Z80 8-Bit Computer Project (2020) - Passion project")],A.R("p<IL>")))
r($,"aKd","akb",()=>A.a([A.LT("As an Intern at Sprout, I have gained knowledge about Flutter App Development. I have built this portfolio as the main task within the internship period. I have studied mobile app development by myself with the help of constructive feedback by my supervisor and the mobile team.\n\nI also have learned more about the concept of clean architecure.\n\nDuring this internship period, I have gained knowledge about how corporate software companies strive to acheive their goal.\n","Sprout Solutions Inc. (2023) - Mobile Developer Intern"),A.LT("As the lead programmer for the research project, I assumed a pivotal role in driving the project's technological aspects and ensuring its successful execution.\n\nOne of my primary responsibilities was overseeing a team of programmers consisting of three members. Together, we collaborated on the development of a web-based HR Information System and a Raspberry Pi fingerprint attendance record system.\n\nFor the web-based HR Information System, we leveraged a range of technologies including the Java Ant Framework, Java Object-Oriented Programming (OOP), JSP pages with JSTL, Bootstrap 5, JavaScript, Apache Tomcat, JDBC, and MySQL. These tools provided a solid foundation for creating a comprehensive and intuitive system that effectively managed HR-related information.\n\nIn parallel, we also worked on the Raspberry Pi fingerprint attendance record system. This solution required a different set of technologies, and we utilized Python, MariaDB, and PySimpleGui to develop a reliable and efficient system for recording attendance using fingerprint recognition through Raspberry Pi devices.\n\nThroughout the project, I took charge of managing the Git repository, ensuring version control, and maintaining code integrity. I placed significant emphasis on producing clean, well-structured code and actively coached and guided the team members in adopting and implementing industry best practices. By doing so, we achieved code consistency, readability, and maintainability, which were vital for the success of the project.\n\nAdditionally, my role as the lead programmer involved a deep understanding of the project's objectives and requirements. I actively engaged in identifying common business practices related to HR management, time and attendance management, and payroll. This knowledge allowed us to tailor the systems to effectively address the specific needs and challenges of the organization.\n\nAs the lead programmer, I played a vital role in driving the research project's technical aspects, fostering a collaborative environment, and ensuring the successful development and implementation of the web-based HR Information System and Raspberry Pi fingerprint attendance record system.\n","Thesis Project (2023) - Lead Programmer"),A.LT("In the data analysis final project of 2023, I took on the role of the lead programmer, responsible for overseeing a team of two members. Our project focused on analyzing and presenting valuable key insights derived from a police crime dataset.\n\nTo begin the data analysis process, we utilized Python programming language along with the Pandas library and Jupyter Notebook. These tools enabled us to clean and preprocess the dataset, ensuring that the data was in a suitable format for analysis.\n\nOnce the dataset was prepared, we turned to Tableau, a powerful data visualization and analysis tool. Leveraging its capabilities, we conducted in-depth analysis of the crime dataset and generated visualizations that effectively communicated key insights to our stakeholders. Tableau allowed us to present the data in a visually appealing and easily understandable manner, facilitating a comprehensive understanding of crime patterns and trends.\n\nOne of our primary objectives in the project was to identify potential areas for improvement in crime prevention. By thoroughly analyzing the dataset, we extracted relevant information and patterns that could contribute to strategies aimed at reducing and preventing crime. We delved into the data, seeking correlations, trends, and anomalies that could inform decision-making and guide proactive measures.\n\nThroughout the project, I led the team in the analysis process, ensuring that we maintained a rigorous and systematic approach. I fostered collaboration and encouraged the exchange of ideas and perspectives among team members, enhancing the quality and depth of our analysis.\n\nAs the lead programmer, my role encompassed overseeing the technical aspects of the project, guiding the team in using the appropriate tools, and ensuring the accuracy and integrity of our findings. Together, we successfully analyzed the police crime dataset, presented valuable key insights, and proposed potential avenues for crime prevention based on the data.\n\nOverall, our data analysis final project encompassed team collaboration, Python-based dataset cleaning, Tableau-based data analysis and visualization, and the identification of actionable insights to improve crime prevention strategies.\n","Data analysis final project (2023) - Lead programmer"),A.LT("In the Music Collaboration Web App project of 2021, I assumed the role of the lead programmer, responsible for leading a team of two members in the development of a collaborative web application tailored for musicians.\n\nAs the project lead, I guided and coordinated the team throughout the development process. Our main objective was to create a platform that facilitated collaboration among musicians, allowing them to connect, share ideas, and work together on music projects.\n\nTo achieve this, we utilized Java servlets and Java Object-Oriented Programming (OOP) principles. These technologies provided a robust foundation for building the server-side components of the web application. We developed Java servlets to handle HTTP requests, manage user authentication and authorization, and implement the core functionalities of the collaboration platform.\n\nIn addition to servlets, we created Java Server Pages (JSP) pages. With the help of JSP, we dynamically generated the user interfaces and incorporated Java code into the web pages. This allowed us to deliver interactive and personalized experiences for musicians using the web app.\n\nTo store and manage the data, we designed a MySQL database. As the lead programmer, I took a proactive role in identifying and implementing best practices in database design. This involved defining the appropriate table structures, establishing relationships between entities, and optimizing the performance and efficiency of database queries.\n\nThroughout the project, I ensured effective collaboration and communication within the team. We followed an agile development methodology, regularly conducting meetings and sprint reviews to track progress, address challenges, and align our efforts. As the lead programmer, I provided guidance and support to the team members, fostering a collaborative and productive environment.\n\nBy leveraging our technical skills in Java servlets, JSP pages, and MySQL database design, we successfully built a functional and user-friendly web application for musicians. The collaborative nature of the platform aimed to enhance musical creativity and facilitate seamless cooperation among musicians.\n\nIn conclusion, as the lead programmer of the Music Collaboration Web App project, I played a crucial role in leading the team, implementing Java servlets and JSP pages, and designing an efficient MySQL database. Our collective efforts resulted in the development of a valuable web application that empowered musicians to collaborate and create music together.\n","Music Collaboration Web App Project (2021) - Lead Programmer"),A.LT("In the Text-Based Game Project of 2020, I assumed the role of the lead programmer, responsible for guiding a team of two members in the development of a fully functional text-based game using Java Object-Oriented Programming (OOP).\n\nAs the lead programmer, my primary objective was to ensure the successful execution of the project. I provided leadership and direction to the team, overseeing the development process from start to finish.\n\nWe leveraged the power of Java OOP to design and implement the game's architecture and functionalities. Using classes, objects, and inheritance, we created a modular and extensible game structure. This approach allowed us to encapsulate game components, manage interactions between different elements, and promote code reusability.\n\nAn essential aspect of the project was mastering programming logic design. By focusing on logical thinking and problem-solving, we were able to create robust and efficient code. We tackled challenges related to gameplay mechanics, user interactions, and decision-making systems, ensuring a smooth and engaging gaming experience.\n\nAdditionally, the project served as an opportunity for the team to explore and learn different development methodologies. We delved into Agile, Waterfall, or other methodologies to understand their principles and benefits. This exposure broadened our perspectives on project management, teamwork, and adaptability, enabling us to choose the most appropriate methodology for our specific project requirements.\n\nThroughout the project, collaboration and knowledge sharing were paramount. I fostered a collaborative environment within the team, encouraging open communication and the exchange of ideas. We worked together to overcome obstacles, brainstorm innovative solutions, and ensure that our game met the desired standards of functionality and quality.\n\nThe Text-Based Game Project of 2020 not only resulted in a fully functional game but also provided invaluable learning experiences. We honed our skills in Java OOP, strengthened our proficiency in programming logic design, and gained insights into different development methodologies. These learnings served as a foundation for our growth as game developers and equipped us with valuable knowledge applicable to future projects.\n\nIn summary, as the lead programmer of the Text-Based Game Project, I led a team of two members in developing a fully functional game using Java OOP. We focused on mastering programming logic design and explored various development methodologies. This project served as a platform for collaboration, learning, and growth, ultimately leading to the successful completion of the text-based game.\n","Text Based Game Project (2020) - Lead Programmer")],A.R("p<LS>")))
